import React from 'react';
import Card from '../UI/Card';
const LogsForm = () => {
    return (
      <Card>
        <form>
          <div>
            <label htmlFor="date"></label>
            <input id="date" type=""/>
          </div>
          <div>
            <label></label>
            <input />
          </div>
          <div>
            <label></label>
            <input />
          </div>
        </form>
      </Card>
    );
};

export default LogsForm;
